Django templates separate HTML presentation from Python logic. Create a templates/polls/index.html file: <h1>Latest Questions</h1>
<ul> {% for question in latest_question_list %} <li>{{ question.question_text }}</li> {% endfor %}
</ul> Update the view to render the template: from django.shortcuts import render
from .models import Question def index(request): latest_question_list = Question.objects.order_by('-pub_date')[:5] context = {'latest_question_list': latest_question_list} return render(request, 'polls/index.html', context)

